INSERT INTO public.pm_subtasklist VALUES ('AWMA_0202', 'AWMA_02', 'Pencarian Dokumen Canggih', '<p>Fitur pencarian berdasarkan nama nasabah, nomor akun, jenis dokumen, tanggal, dll.</p>', '58258b21-1bb5-4719-b334-6de9b9b13883.png', 'intern-02', 'Afif Lukmanul Hakim', 'IN_PROGRESS') ON CONFLICT DO NOTHING;
INSERT INTO public.pm_subtasklist VALUES ('AWMA_0203', 'AWMA_02', 'Kategori dan Folder Dokumen', '<p>Dokumen dapat dikelompokkan dalam kategori tertentu, misalnya berdasarkan jenis (kontrak, laporan keuangan), tanggal, atau divisi yang terkait.</p>', '6feb99ea-cfbd-48b6-bde8-4fd5af59298d.png', 'intern-02', 'Lailatul_Badriyah', 'IN_PROGRESS') ON CONFLICT DO NOTHING;
INSERT INTO public.pm_subtasklist VALUES ('AWMA_0302', 'AWMA_03', 'Implementasi Role-Based Authentication', '<p>Integrasikan sistem otentikasi pengguna yang mendukung peran, sehingga saat login, peran pengguna akan teridentifikasi dan dikaitkan dengan hak akses yang relevan. Gunakan OAuth2 atau JWT untuk memastikan keamanan otentikasi.</p>', 'f8965aba-af7b-4eae-a4bf-55a0b0f89523.png', 'intern-02', 'Ilham Yudantyo', 'IN_PROGRESS') ON CONFLICT DO NOTHING;
INSERT INTO public.pm_subtasklist VALUES ('BCCC_0101', 'BCCC_01', 'Implement API connection between Call Center and core banking system.', '<p>Implement API connection between Call Center and core banking system.</p>', '4acbdf09-e4d3-4852-9e6a-7cedce188712.jpeg', '19205707', 'Dwi_Putra_Ardes_Nugroho', 'TODO') ON CONFLICT DO NOTHING;
INSERT INTO public.pm_subtasklist VALUES ('BCCC_0102', 'BCCC_01', 'Secure the API connection using OAuth2 to ensure data protection during data retrieval.', '<p>Secure the API connection using OAuth2 to ensure data protection during data retrieval.</p>', 'e4a68024-1095-4151-b3a7-d6da2df29c53.jpeg', '19205707', 'Dwi_Putra_Ardes_Nugroho', 'TODO') ON CONFLICT DO NOTHING;
