INSERT INTO public.pm_subtasklist VALUES ('BCCC_0301', 'BCCC_03', 'Set up email and SMS templates with dynamic customer data fields.', '<p>Set up email and SMS templates with dynamic customer data fields.</p>', '79651a50-062f-4465-970f-89cc05cdc00d.jpeg', '19205707', 'Tania_Sulastri_Munte', 'TODO') ON CONFLICT DO NOTHING;
